import java.util.LinkedHashMap;
import java.util.Map;

public class FindtheDifference {
    public static void main(String[] args) {
        String first = "";
        String second = "";
        char ans = findTheDifference(first, second);
        System.out.println(ans); // Should print 'a'
    }

    public static char findTheDifference(String first, String second) {
        char[] firstArray = first.toCharArray();
        char[] secondArray = second.toCharArray();
        
        // Initialize maps to store character counts
        Map<Character, Integer> map1 = new LinkedHashMap<>();
        Map<Character, Integer> map2 = new LinkedHashMap<>();

        // Populate map1 with character counts from first
        for (char c : firstArray) {
            // map1.put(c, map1.getOrDefault(c, 0) + 1);
            if(map1.containsKey(c)==false){
                map1.put(c, 1);
            }
            else{
                int oldValue=map1.get(c);
                int newValue=oldValue+1;
                map1.put(c, newValue);
            }
        }

        // Populate map2 with character counts from second
        for (char c : secondArray) {
            // map2.put(c, map2.getOrDefault(c, 0) + 1);
            if(map2.containsKey(c)==false){
                map2.put(c, 1);
            }
            else{
                int oldValue=map2.get(c);
                int newValue=oldValue+1;
                map2.put(c, newValue);
            }
        }

        // Compare map1 values with map2 values
        char result = ' ';
        for (char key : map2.keySet()) {
            if (!map1.containsKey(key) || map1.get(key) != map2.get(key)) {
                result = key;
                break;
            }
        }

        return result;
    }
}
